Introducing with excitement the Inaugural Edition of INTHEARTS, the magazine that explores the wonders of contemporary textile art!  We've interviewed visionary artists from around the world to bring you a unique experience. 

In this edition, we highlight the incredible talents of Ariadna Pastorini, Cathy Jacobs, Cecilia Acevedo, Cristina Lisot, Ipheno, Irina Laaja, Jason Kriegler, Lara Zappa, Lia Porto, Linda Männel, Paula Ceroni, Rachael Wellisch, and Vanessa Freitag.  If you're passionate about art and seeking inspiration, you can't miss it!

Discover the creative processes, inspiring stories, and intricate details behind the works of these brilliant artists who are redefining the boundaries of textile expression.

Read your exclusive copy of INTHEARTS now at www.museutextil.com and dive into the fascinating world of contemporary textile art.

It's not just a magazine but a sensory journey celebrating the beauty that can be created from threads and fabrics.

